import { Fragment, useEffect } from "react";

const ProductList = (props) => {

    const product = { id: 5, name: 'soap', description: 'cleans everything', price: 100 };

    useEffect( () => {
        console.log(product);
    });


    return (
        <Fragment>
            This is the List of Products!!!!
            <Productd
                name={product.name}
                description={product.description}
                price={product.price} />

            <Productd
                name={product.name}
                description={product.description}
                price={product.price} />

            <Productd
                name={product.name}
                description={product.description}
                price={product.price} />

            <Productd
                name={product.name}
                description={product.description}
                price={product.price} />
        </Fragment>
    );
};
export default ProductList;

const Productd = (props) => {

    const divStyle = {
        bordercolor: 'red',
        border: '2px solid red',
    };

    return (
        <div style={divStyle}>
            <h3>{props.name}</h3>
            <p>{props.description}</p>
            <p>Costs AUD $ {props.price}</p>
        </div>
    );
};
